"""
0) Please understand that this could brick/damage your device and that if something goes wrong there's no recovery possible.
1) Make sure your headphones are running firmware version 4.1.1
2) Perform a factory reset. Turn headphones off, then hold both "Power" and "NC" buttons until the blue led blinks 4 times (hold for about 7 seconds)
3) Remove headphones from your phone's bluetooth settings (otherwise they wouldn't pair) and the Sony app if you have it installed. You might have 2 entries (LE_ and normal), remove both.
4) Pair headphones with your phone
5) Open the Sony app and make sure headphones are registered and show up the correct firmware version
6) Run the downgrader.py script on your PC. You need to use Python 3 to run it, download from https://www.python.org/downloads/
7) Ensure any firewalls are off or allow port 1337 through. Your PC and phone must be on the same network.
8) Figure out the IP address of your PC on your local network. You can use "ipconfig" on Windows to do that.
9) In your phone wifi settings, set up the HTTP proxy. Set its host to your PC IP address and the port to 1337.
    Android: Settings -> Network -> Wi-Fi -> Hold on your home network name -> Modify network -> Proxy: select "Manual" -> Proxy hostname: enter your PC IP, Proxy port: enter 1337 -> Save
    iOS: Settings -> Wi-Fi -> click info circle -> HTTP Proxy -> Configure Proxy: Manual -> Server: Your PC IP -> Port: 1337
10) Check that the proxy works. From a web browser on your phone, open a new incognito tab and navigate to http://downgrader.test/ You should see a message indicating it's set up correctly
11) Open the Sony Headphones Connect app. It should notify you that a new update is available.
12) Check that it says 2.0.0 version is going to be installed. Then, confirm the installation.
13) Wait for the firmware to be transferred and installed to the headphones.
14) Once the headphones reboot, turn them off and perform a factory reset again, same as in steps 2-3.
15) Terminate the Python script running on your PC and don't forget to disable proxy settings on your phone.
16) Done. You can turn the headphones on and pair them now.
"""

